    stream erosion.  An erosion site is usually identified as a result of a complaint
    generated by a citizen or city staff.  Erosion sites are then prioritized based
    upon the type of resource threatened, proximity to the stream bank, stream bank
    geometry, and likelihood of bank failure; and then stream restoration projects https://data.austintexas.gov/Environmental/Stream-Restoration-Projects/2c74-xuqw
